import{_ as e,o as a,c as r,e as n}from"./chunks/framework.78e651f5.js";const k=JSON.parse('{"title":"Нейрон","description":"Хакспейс","frontmatter":{"title":"Нейрон","description":"Хакспейс","date":"2015-04-26","icon":"G5xZ4RHik2M.jpg","cover":"IMG_0103.jpg","email":"neuron@hackspace.ru","url":"https://neuronspace.ru","address":"Хохловский пер., 7/9с2","place":"м. Китай-город","city":"г. Москва","tel":"+7 (495) 008-13-37","vk":"neuronspace","youtube-channel":"UCmJNyrEsnoDCJghI-5BXrTw","status":"closed","telegram":"neuronspace","instagram":"neuronspace","facebook":"neuronspace"},"headers":[],"relativePath":"workshop/archive/hackspace-neuron/index.md","filePath":"workshop/archive/hackspace-neuron/index.md"}'),t={name:"workshop/archive/hackspace-neuron/index.md"},l=n('<p>Хакспейс Neuron – независимая некоммерческая организация, полностью управляемая её членами. Первый хакспейс в России, существует с июля 2011 года.</p><p>Что ты получаешь, приходя в хакспейс Neuron?</p><ul><li>Электричество и интернет</li><li>Паяльное оборудование</li><li>Чай и кофе (еда – в кафе рядом)</li><li>Библиотеку хакспейса</li><li>Гиковскую атмосферу</li></ul><p>Постоянным членам также доступны:</p><ul><li>Скидки на пользование 3D-принтерами</li><li>Радиооборудование (спектроанализатор, SDR оборудование, GSM базовые станции и т.д.)</li><li>Всякое разное другое оборудование</li><li>Доступ к закрытым мероприятиям</li></ul><p><img src="http://neuronspace.ru/wp/wp-content/uploads/2013/03/650x468xsoldering-650x468.jpg.pagespeed.ic.1-WQnZtW_e.webp" alt=""></p><h2 id="для-постоянных-членов" tabindex="-1">Для постоянных членов <a class="header-anchor" href="#для-постоянных-членов" aria-label="Permalink to &quot;Для постоянных членов&quot;">​</a></h2><p><strong>Посетитель (Dynamic)</strong> – 3 000 рублей в месяц.</p><p>Доступ в хакспейс в любое время без ограничений. Скидки и оборудование, доступные только для членов. Ты поддерживаешь развитие хакерской культуры в России.</p><p><strong>Резидент (Static)</strong> – 10 000 рублей в месяц.</p><p>Все бонусы dynamic членства, плюс возможность иметь личный уголок. Перенеси своё рабочее место в хакспейс!</p><h2 id="для-гостеи" tabindex="-1">Для гостей <a class="header-anchor" href="#для-гостеи" aria-label="Permalink to &quot;Для гостей&quot;">​</a></h2><p><strong>Гость (Day pass)</strong> – 500 рублей в день.</p><p>Возможность пользоваться инфраструктурой хакспейса в течение одного дня. Хакспейс открыт только когда есть кто-то из постоянных членов, и чтобы не оказаться перед закрытой дверью, лучше заранее написать на <a href="mailto:neuron@hackspace.ru" target="_blank" rel="noreferrer">neuron@hackspace.ru</a>.</p><h2 id="мероприятия" tabindex="-1">Мероприятия <a class="header-anchor" href="#мероприятия" aria-label="Permalink to &quot;Мероприятия&quot;">​</a></h2><p>Хакспейс Neuron – это идеальное место для проведения семинаров, meetup’ов и мини-конференций по любым <strong>гиковским, хакерским и интересным околоайтишной аудитории темам (важна специфика)</strong>. Если вам не хочется делать мероприятие в кафе или просить какую-нибудь компанию вас приютить – приходите к нам. Мы не будем накладывать на ваше мероприятие корпоративные ограничения и утруждать прочими глупостями.</p><p>Мы рады хостить как платные, так и бесплатные мероприятия.</p><p>Помещение вмещает:</p><ul><li><strong>около 20 человек в формате воркшопа,</strong></li><li><strong>около 40 человек в формате лекции.</strong></li></ul><p>Во время мероприятий доступны:</p><ul><li>интернет (WiFi, Ethernet)</li><li>проектор (VGA, 800х600)</li><li>2 беспроводных микрофона (2.5″ или 3.5″ jack)</li><li>динамики (3.5″ jack)</li><li>вёб-камера на штативе (HD, USB)</li></ul><p><a href="https://habr.com/ru/company/neuronspace/blog/494128/" class="external-link" target="_blank" rel="noreferrer">Статья про Нейрон на Хабре</a><a href="https://xakep.ru/2012/10/26/hack-space-neuron/" class="external-link" target="_blank" rel="noreferrer">Статья на Xakep.ru</a><a href="https://te-st.ru/2014/08/06/hakspeys-neuron-russia/" class="external-link" target="_blank" rel="noreferrer">Статья в Теплице социальных технологий</a></p>',22),o=[l];function i(s,p,c,u,h,d){return a(),r("div",null,o)}const g=e(t,[["render",i]]);export{k as __pageData,g as default};
